import java.util.*;

public class N451根据字符出现频率排序 {
    public static String frequencySort(String s) {
        HashMap<Character,  Integer> fre = new HashMap<>();
        for(int i=0;i<s.length();i++){
            if(fre.containsKey(s.charAt(i))){
                fre.replace(s.charAt(i), fre.get(s.charAt(i)), fre.get(s.charAt(i))+1);
            }else{
                fre.put(s.charAt(i), 1);
            }
        }
        List<Map.Entry<Character, Integer>> list = new ArrayList<>(fre.entrySet());
        Collections.sort(list, new Comparator<Map.Entry<Character, Integer>>() {
            @Override
            public int compare(Map.Entry<Character, Integer> o1, Map.Entry<Character, Integer> o2) {
                return (o2.getValue()-o1.getValue());
            }
        });
        String res="";
        for(Map.Entry<Character, Integer> entry: list){
            for(int j=0;j<entry.getValue();j++)
            res = res + entry.getKey();
        }
        System.out.println(res);
        return res;
    }

    public static void main(String[] args){
        String s = "";
        frequencySort(s);
    }
}
